import {ActionTypes} from '../constants'

const initialState = {
	business: []
};

const reducer = (state = initialState, {type, payload}) => {
	switch (type) {
		case 'GET_BUSINESS':
			return {
				...state,
				business: payload,
			};
		default:
			return state;
	}
};

export default reducer;
